import React from 'react';

const FilterTasks = ({ filter, setFilter }) => {
  return (
    <div>
      <input 
        type="text" 
        value={filter} 
        onChange={(e) => setFilter(e.target.value)} 
        placeholder="Filtrar tarefas por título..." 
      />
    </div>
  );
};

export default FilterTasks;
